import React from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';

const SpaceCard = ({ space }) => {
  const navigate = useNavigate();

  return (
    <motion.div
      whileHover={{ scale: 1.05 }}
      className="border rounded-lg shadow-md cursor-pointer hover:shadow-lg transition overflow-hidden"
      onClick={() => navigate(`/space/${space.id}`)}
    >
      <img
        src={space.image}
        alt={space.name}
        className="w-full h-48 object-cover"
      />
      <div className="p-4">
        <h2 className="font-bold text-lg">{space.name}</h2>
        <p className="text-gray-500">{space.location}</p>
        <p className="text-blue-500 font-bold">{space.price}/mes</p>
      </div>
    </motion.div>
  );
};

export default SpaceCard;
